import React from 'react';
import Select from 'react-select';

const Chat = () => {
  const options = [
    { value: 'option1', label: 'Vaihtoehto 1' },
    { value: 'option2', label: 'Vaihtoehto 2' },
    { value: 'option3', label: 'Vaihtoehto 3' },
  ];

  return (
    <div>
      <nav className="navbar">
        <ul>
          <input placeholder='Search by username' className='searchInput' />
        </ul>
      </nav>
      <Select
        options={options}
        isSearchable={true}
        placeholder="Valitse vaihtoehto"
      />
    </div>
  );
};


export default Chat;
